import React from 'react'
import { Link } from 'react-router-dom'

const ListItems = ({ note }) => {
    return (
        <Link to ={`/note/${note.id}`}>
            <div></div>
            <h3>{ note.body }</h3>
        </Link>
    )
}

export default ListItems
